import React, { useState} from "react";
import styled from "styled-components";

import PageWrapper from "../components/PageWrapper";
import withLoading from "../HOC/withLoading";
import fetchQuery from "../hooks/fetchQuery";
import fs from 'fs';


const DropDownContent = styled.div`
    display: none;
    position: absolute;
    min-width: 160px;
    z-index: 1;
`;

const DropDownLi = styled.div`
    display: inline-block;
    &:hover ${DropDownContent} {
        display: block;
    }
`;

const Input = styled.input`
    margin-top: 20px;
    margin-left: 20px;
    padding: 2px;
    width: 300px;
    font-size: 16px;
`;



const AddBook = () => {
  const [criteria, setCriteria] = useState("Title");
  const [inputValue, setInputValue] = useState("");
  const [sort, setSort] = useState("relevance");
  const [books , setBooks] = useState([]);

  const handleSearch = async () => {
    const result = await fetchQuery(null, criteria, inputValue, sort)
    setBooks(result || [])
    console.log(books)
  };

  const addtoLib = (book) => {
    alert("Book added to your library!");
    let new_book = {title: book.volumeInfo.title, author: book.volumeInfo.authors?.join(', '), imgsrc: book.volumeInfo.imageLinks?.smallThumbnail, publisher: book.volumeInfo.publisher};
    let data = fs.readFileSync('../components/mybooks.json');
    let mybooks = JSON.parse(data);
    mybooks.push(new_book);
    fs.writeFileSync('../components/mybooks.json', JSON.stringify(mybooks, null, 2));
  }

  return (
    <PageWrapper>
      <div>
      <h2>Find Your Books</h2>
      <DropDownLi>
        Search By: {criteria}
        <DropDownContent>
          <div onClick={() => setCriteria("Title")}>Title</div>
          <div onClick={() => setCriteria("Author")}>Author</div>
          <div onClick={() => setCriteria("ISBN")}>ISBN</div>
        </DropDownContent>
      </DropDownLi>
      <DropDownLi style={{marginLeft: '20px'}}>
        Sort By: {sort}
        <DropDownContent>
          <div onClick={() => setSort("relevance")}>relevance</div>
          <div onClick={() => setSort("newest")}>newest</div>
        </DropDownContent>
      </DropDownLi>
      
      <Input type="text" value={inputValue} onChange={(e) => setInputValue(e.target.value)} placeholder={`Enter ${criteria}`} />
      <button style={{marginLeft: '10px', padding: '5px 10px'}} onClick={handleSearch}>Search</button>
      </div>
      <div style={{display: 'flex', flexWrap: 'wrap', marginTop: '20px'}}>
        {books.length > 0 && books.map(book => (
          <div key={book.id} style={{border: '1px solid #ccc', margin: '10px', padding: '10px', display: 'flex', flexDirection: 'column', alignItems: 'center', width: '150px'}}>
            <h3>{book.volumeInfo.title}</h3>
            <img src={book.volumeInfo.imageLinks?.smallThumbnail} alt={book.volumeInfo.title} />
            <button onClick={addtoLib}>Add to Library</button>

          </div>
        ))}
      </div>
    </PageWrapper>  
  );
};

export default withLoading(AddBook);
